import React from 'react';
import './Home.css';
import imageOne from '../../Images/Image-1.jpg'
import imageTwo from '../../Images/Image-2.jpg'

const Home = () => {
  return (
    <div className="about-us-container">
      <h1>Home</h1>
      <img className='img-1' src={imageOne} alt='headerImg' />
      <p>Welcome to our to-do list app! We're passionate about helping you stay organized and achieve your goals.</p>
      <img className='img-2' src={imageTwo} alt='' />
      <h2>Our Mission</h2>
      <p>Our mission is to provide a simple and effective tool for managing your tasks and increasing productivity.</p>
      <h2>Contact Us</h2>
      <p>If you have any questions or feedback, feel free to reach out to us at lal.vaibhav0211@gmail.com .</p>
    </div>
  );
};

export default Home;
